/* model version */
#define NNOM_MODEL_VERSION (10000*0 + 100*4 + 3)

/* nnom model */
static nnom_model_t* nnom_model_create(void)
{
	static nnom_model_t model;
	nnom_layer_t* layer[20];

	check_model_version(NNOM_MODEL_VERSION);
	new_model(&model);

	layer[0] = input_s(&input_4_config);
	layer[1] = model.hook(conv2d_s(&conv1d_12_config), layer[0]);
	layer[2] = model.active(act_relu(), layer[1]);
	layer[3] = model.hook(maxpool_s(&max_pooling1d_12_config), layer[2]);
	layer[4] = model.hook(conv2d_s(&conv1d_13_config), layer[3]);
	layer[5] = model.hook(conv2d_s(&conv1d_14_config), layer[3]);
	layer[6] = model.active(act_relu(), layer[4]);
	layer[7] = model.active(act_relu(), layer[5]);
	layer[8] = model.hook(maxpool_s(&max_pooling1d_15_config), layer[3]);
	layer[9] = model.hook(maxpool_s(&max_pooling1d_13_config), layer[6]);
	layer[10] = model.hook(maxpool_s(&max_pooling1d_14_config), layer[7]);
	layer[11] = model.mergex(concat_s(&concatenate_3_config), 3 ,layer[9] ,layer[10] ,layer[8]);
	layer[12] = model.hook(conv2d_s(&conv1d_15_config), layer[11]);
	layer[13] = model.active(act_relu(), layer[12]);
	layer[14] = model.hook(flatten_s(&flatten_3_config), layer[13]);
	layer[15] = model.hook(dense_s(&dense_6_config), layer[14]);
	layer[16] = model.active(act_relu(), layer[15]);
	layer[17] = model.hook(dense_s(&dense_7_config), layer[16]);
	layer[18] = model.hook(softmax_s(&softmax_3_config), layer[17]);
	layer[19] = model.hook(output_s(&output0_config), layer[18]);
	model_compile(&model, layer[0], layer[19]);
	return &model;
}
